The planned merger between US Steel and Nippon Steel has faced significant challenges and regulatory scrutiny. Initially announced as a $15 billion deal to enhance global competitiveness, the merger was blocked by President Biden in January 2025 due to national security concerns. The decision emphasized the need to maintain a domestically controlled steel industry, despite assurances from Nippon Steel to protect US jobs and facilities.

Following Biden's block, President Trump ordered a new review of the acquisition by the Committee on Foreign Investment in the United States (CFIUS) to assess if proposed measures could mitigate national security risks. This review, which is ongoing, has led to a significant increase in US Steel's stock price and has opened the possibility of Nippon Steel investing heavily in US Steel rather than acquiring it outright.

The blockage of the merger has raised concerns among Japanese investors about the risks of cross-border investments in the US, particularly in sectors critical to national security. The situation remains dynamic, with potential for reassessment under the Trump administration, which might renegotiate terms to address national security concerns. This case highlights the complexities of international mergers involving critical industries and the influence of political considerations on business operations.

